INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "青空の下で謁見", "ペコリーヌとの出会い", 2834, 8, 2, 0, 7, 10118, 91002, 0, 5118061, 1, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "フリーマーケット会場");
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "未来の騎空団\nマスコット？", "マホとの出会い", 2835, 8, 2, 0, 7, 10118, 91002, 0, 5118062, 1, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "フリーマーケット会場");
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "お嬢さまからの\n緊急依頼", "アキノとの出会い", 2837, 8, 2, 0, 7, 10118, 91002, 0, 5118063, 1, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "ランドソル市街地");
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "黄金色の悩みごと", "ジュンとの出会い", 4108402, 8, 2, 0, 18, 10118, 91002, 0, 5118064, 1, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "フリーマーケット会場");
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "白熱！　格闘大会！", "カオリとの出会い", 4107402, 8, 2, 0, 18, 10118, 91002, 0, 5118065, 1, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "フリーマーケット会場");
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "祭り太鼓はオーエドの華", "ニノンとの出会い", 9000227, 8, 2, 1, 16, 10118, 91002, 0, 5118066, 1, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "オーエド町");
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "人気者は遅れて\nやってくる", "スズナとの出会い", 2101181, 8, 3, 0, 19, 10118, 91002, 0, 5118067, 1, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "フリーマーケット会場");
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "巫女・ミーツ・魔法少女", "ナナカとの出会い", 4109402, 8, 3, 0, 18, 10118, 91002, 0, 5118068, 1, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ランドソル市街地");
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "ネズ耳は二度なくなる", "キャル＆コッコロとの出会い", 4305402, 8, 3, 0, 18, 10118, 91002, 0, 5118069, 1, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "フリーマーケット会場");
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "この出会いにカンパイ！", "ユカリとの出会い", 4101402, 8, 3, 0, 18, 10118, 91002, 0, 5118070, 1, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ランドソル市街地");
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "陰陽アンサンブル", "アオイとの出会い", 4106402, 8, 3, 0, 18, 10118, 91002, 0, 5118071, 1, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "ランドソル市街地");
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (40, "運試し十番勝負！", "シノブとの出会い", 2836, 8, 3, 1, 7, 10118, 91002, 0, 5118072, 1, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "フリーマーケット会場");
INSERT INTO `v1_a5c25911bf46e23e46cba00a620bd71d4495c3c4ae5d6722af5bc155e72d3631` VALUES (0, "彼女たちの新たな日常", "オープニング", 0, 0, 1, 0, 0, 10118, 0, 10145115, 5118600, 0, 0, 0);
